import React from "react";
import Notes from "./Notes";

const NotesList = ({ notes, onHandleDeleteNote }) => {
    return (
        <div className="notesList">
            {notes.map((note) => (
                <Notes
                    key={note.id}
                    id={note.id}
                    text={note.text}
                    date={note.date}
                    onHandleDeleteNote={onHandleDeleteNote}
                />
            ))}
        </div>
    );
};

export default NotesList;
